import React, { useState } from 'react';
import '../App.css';

const PrettyCounter = (props) => {

    const [count, setCount] = useState(0);

    const increase = () => {
        setCount(count+1)
    }

    const decrease = () => {
        setCount(count-1)
    }

    return (
        <div>
            <div>My Pretty Counter</div>
            <button onClick={decrease}>
                -
            </button>
            {count}
            <button onClick={increase}>
                +
            </button>
        </div>
    );
}

export default PrettyCounter;
